import React, { Component } from 'react';

export class Ihop extends Component {

    styles = {
        image: {
          width: 200,
          height: 150
        }
      };

    render() { 
        return (  
            <div>
                <h1>IHOP</h1>
                <img class = "img-thumbnail" src = {require("./restaurant_photos/ihop.jpg")} style = {this.styles.image}/>
                <h5>Location:</h5>
                <p>707 E Cesar Chavez St, Austin, TX 78701</p>
                <h5>Cuisine:</h5>
                <p>American (breakfast)</p>
                <h5>Cost ($-$$$$$)</h5>
                <p>$$$</p>
                <h5>Contact:</h5>
                <p>(512) 478-9520</p>
                <h5>Rating (Google Reviews)</h5>
                <p>3.7/5</p>
            </div>
        );
    }
}

export class SushiJanai extends Component {

    styles = {
        image: {
          width: 200,
          height: 150
        }
      };

    render() { 
        return (  
            <div>
                <h1>Sushi Janai</h1>
                <img class = "img-thumbnail" src = {require("./restaurant_photos/sushijanai.jpg")} style = {this.styles.image}/>
                <h5>Location:</h5>
                <p>1612 Lavaca St, Austin, TX 78701</p>
                <h5>Cuisine:</h5>
                <p>Japanese (Seafood)</p>
                <h5>Cost ($-$$$$$)</h5>
                <p>$$$</p>
                <h5>Contact:</h5>
                <p>(512) 322-2428</p>
                <h5>Rating (Google Reviews)</h5>
                <p>4.4/5</p>
            </div>
        );
    }
}
